import { Doughnut } from "react-chartjs-2";
import { Bar, Line, Pie } from "react-chartjs-2";
const Chart = (props) => {
  return (
    <Line
      width={10}
      data={{
        labels: props.x.slice(-100),
        datasets: [
          {
            label: "Population",
            data: props.y.slice(-100),
            backgroundColor: [
              "rgba(255, 99, 132, 0.6)",
              "rgba(54, 162, 235, 0.6)",
              "rgba(255, 206, 86, 0.6)",
              "rgba(75, 192, 192, 0.6)",
              "rgba(153, 102, 255, 0.6)",
              "rgba(255, 159, 64, 0.6)",
              "rgba(255, 99, 132, 0.6)",
            ],
          },
        ],
      }}
    />
  );
};

export default Chart;
